
CREATE DATABASE IF NOT EXISTS w3schools;
USE w3schools;

DROP TABLE IF EXISTS Customers;
CREATE TABLE `Customers` ( `CustomerID` int(11) NOT NULL AUTO_INCREMENT, `CustomerName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `ContactName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Address` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `City` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `PostalCode` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Country` varchar(255) CHARACTER SET utf8 DEFAULT NULL, PRIMARY KEY (`CustomerID`) ) ;

DROP TABLE IF EXISTS Categories;
CREATE TABLE `Categories` ( `CategoryID` int(11) NOT NULL AUTO_INCREMENT, `CategoryName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Description` varchar(255) CHARACTER SET utf8 DEFAULT NULL, PRIMARY KEY (`CategoryID`) ) ;

DROP TABLE IF EXISTS Employees;
CREATE TABLE `Employees` ( `EmployeeID` int(11) NOT NULL AUTO_INCREMENT, `LastName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `FirstName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `BirthDate` date DEFAULT NULL, `Photo` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Notes` longtext, PRIMARY KEY (`EmployeeID`) ) ;

DROP TABLE IF EXISTS OrderDetails;
CREATE TABLE `OrderDetails` ( `OrderDetailID` int(11) NOT NULL AUTO_INCREMENT, `OrderID` int(11) DEFAULT NULL, `ProductID` int(11) DEFAULT NULL, `Quantity` int(11) DEFAULT NULL, PRIMARY KEY (`OrderDetailID`) ) ;

DROP TABLE IF EXISTS Orders;
CREATE TABLE `Orders` ( `OrderID` int(11) NOT NULL AUTO_INCREMENT, `CustomerID` int(11) DEFAULT NULL, `EmployeeID` int(11) DEFAULT NULL, `OrderDate` date DEFAULT NULL, `ShipperID` int(11) DEFAULT NULL, PRIMARY KEY (`OrderID`) ) ;

DROP TABLE IF EXISTS Products;
CREATE TABLE `Products` ( `ProductID` int(11) NOT NULL AUTO_INCREMENT, `ProductName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `SupplierID` int(11) DEFAULT NULL, `CategoryID` int(11) DEFAULT NULL, `Unit` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Price` decimal(10,2) DEFAULT NULL, PRIMARY KEY (`ProductID`) ) ;

DROP TABLE IF EXISTS Shippers;
CREATE TABLE `Shippers` ( `ShipperID` int(11) NOT NULL AUTO_INCREMENT, `ShipperName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Phone` varchar(255) CHARACTER SET utf8 DEFAULT NULL, PRIMARY KEY (`ShipperID`) ) ;

DROP TABLE IF EXISTS Suppliers;
CREATE TABLE `Suppliers` ( `SupplierID` int(11) NOT NULL AUTO_INCREMENT, `SupplierName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `ContactName` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Address` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `City` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `PostalCode` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Country` varchar(255) CHARACTER SET utf8 DEFAULT NULL, `Phone` varchar(255) CHARACTER SET utf8 DEFAULT NULL, PRIMARY KEY (`SupplierID`) ) ;

SELECT
    table_name, table_rows
FROM
    information_schema.tables
WHERE
        table_schema = 'w3schools'
ORDER BY 1;